script: |
  super -f text -I q7128.spq | sort > q7128.out

inputs:
  - name: q7128.spq
    data: |
      SELECT DISTINCT - col1 * 36 FROM tab2 (FORMAT parquet) WHERE col2 * - 73 * + col1 NOT BETWEEN col1 + col1 AND ( col0 ) / col2;
  - name: tab2

outputs:
  - name: q7128.out
    data: |
      -1836
      -2412
      -2772
